jQuery(function() {
	initFancybox();
	initMobileNav();
	initAnchors();
	initBackgroundVideo();
	initOpenClose();
	initSlideShow();
	initStickyScrollBlock();
	initRangeSlider();
	initSplit();
	initLocationData();
});

function initLocationData(){
	jQuery('.question-block').each(function(){
		var holder = jQuery(this),
			btnLocation = holder.find('.btn-locate'),
			answerBlock = '.block-right',
			activeClass = 'active',
			activeBlock = 'section-active';

		btnLocation.on('click', function(e){
			var self = jQuery(this),
				target = self.attr('href');
			e.preventDefault();

			self.closest('li').addClass(activeClass).siblings().removeClass(activeClass);
			jQuery(target).addClass(activeBlock).siblings().removeClass(activeBlock);

			var blockOffset = jQuery(answerBlock).offset().top;
			var targetPos = jQuery(target).offset().top;
			var topPos = targetPos - blockOffset;
			jQuery(answerBlock).animate({ scrollTop: targetPos - blockOffset }, 1000);
		})  
		
	})
}
function initRangeSlider(){
	$(".score-range").asRange({
	  step: 0.1,
	  range: false,
	  min: 0,
	  max: 10
	});
}

function initSplit(){
	Split(['#split-one', '#split-two'], {
		elementStyle: function(dimension, size, gutterSize) {
			return {
				'flex-basis': 'calc(' + size + '% - ' + gutterSize + 'px)',
			}
		},
		gutterStyle: function(dimension, gutterSize) {
			return {
				'flex-basis': gutterSize + 'px',
			}
		},
	})
	Split(['#split-three', '#split-four'], {
		elementStyle: function(dimension, size, gutterSize) {
			return {
				'flex-basis': 'calc(' + size + '% - ' + gutterSize + 'px)',
			}
		},
		gutterStyle: function(dimension, gutterSize) {
			return {
				'flex-basis': gutterSize + 'px',
			}
		},
	})
	Split(['#split-five', '#split-six'], {
		elementStyle: function(dimension, size, gutterSize) {
			return {
				'flex-basis': 'calc(' + size + '% - ' + gutterSize + 'px)',
			}
		},
		gutterStyle: function(dimension, gutterSize) {
			return {
				'flex-basis': gutterSize + 'px',
			}
		},
	})
	Split(['#split-seven', '#split-eight'], {
		elementStyle: function(dimension, size, gutterSize) {
			return {
				'flex-basis': 'calc(' + size + '% - ' + gutterSize + 'px)',
			}
		},
		gutterStyle: function(dimension, gutterSize) {
			return {
				'flex-basis': gutterSize + 'px',
			}
		},
	})
}

// initialize fixed blocks on scroll
function initStickyScrollBlock() {
	jQuery('.question-palette-sticky').stickyScrollBlock({
		setBoxHeight: true,
		activeClass: 'fixed-position',
		container: '#main',
		positionType: 'fixed',
		extraTop: function() {
			var totalHeight = 0;
			jQuery('.test-header').each(function() {
				totalHeight += jQuery(this).outerHeight();
			});
			return totalHeight;
		}
	});
	jQuery('.reading-test-palette').stickyScrollBlock({
		setBoxHeight: true,
		activeClass: 'fixed-position',
		container: '#main',
		positionType: 'fixed',
		extraTop: function() {
			var totalHeight = 0;
			jQuery('.test-header').each(function() {
				totalHeight += jQuery(this).outerHeight();
			});
			return totalHeight;
		}
	});
}


// fade gallery init
function initSlideShow() {
	jQuery('.slideshow').fadeGallery({
		slides: '.slide',
		btnPrev: '.btn-prev',
		btnNext: '.btn-next',
		btnPlay: '.start-rotaion',
		btnPause: '.pause-rotation',
		btnPlayPause: '.toggle-rotation'
	});
}



// lightbox init
function initFancybox() {
	jQuery('a.lightbox, [data-fancybox]').fancybox({
		parentEl: 'body',
		margin: [50, 0]
	});
}

// mobile menu init
function initMobileNav() {
	jQuery('body').mobileNav({
		menuActiveClass: 'nav-active',
		menuOpener: '.nav-opener,.menu-close'
	});
}

// background video init
function initBackgroundVideo() {
	jQuery('.bg-video').backgroundVideo({
		activeClass: 'video-active'
	});
}

// initialize smooth anchor links
function initAnchors() {
	new SmoothScroll({
		anchorLinks: 'ul.menu a[href^="#"]:not([href="#"])',
		extraOffset: function() {
			var totalHeight = 0;
			jQuery('#header').each(function() {
				var $box = jQuery(this);
				var stickyInstance = $box.data('StickyScrollBlock');
				if (stickyInstance) {
					stickyInstance.stickyFlag = false;
					stickyInstance.stickyOn();
					totalHeight += $box.outerHeight();
					stickyInstance.onResize();
				} else {
					totalHeight += $box.css('position') === 'fixed' ? $box.outerHeight() : 0;
				}
			});
			return totalHeight;
		},
		activeClasses: 'link',
		wheelBehavior: 'none'
	});
	new SmoothScroll({
		anchorLinks: '.down-s',
		extraOffset: function() {
			var totalHeight = 0;
			jQuery('.test-header').each(function() {
				var $box = jQuery(this);
				var stickyInstance = $box.data('StickyScrollBlock');
				if (stickyInstance) {
					stickyInstance.stickyFlag = false;
					stickyInstance.stickyOn();
					totalHeight += $box.outerHeight();
					stickyInstance.onResize();
				} else {
					totalHeight += $box.css('position') === 'fixed' ? $box.outerHeight() : 0;
				}
			});
			return totalHeight;
		},
		wheelBehavior: 'none'
	});
}

// open-close init
function initOpenClose() {
	jQuery('.testimonial').openClose({
		activeClass: 'active',
		opener: '.opener',
		slider: '.slide',
		animSpeed: 400,
		effect: 'slide'
	});

	jQuery('.toggle-block').openClose({
		activeClass: 'active',
		opener: '.opener',
		slider: '.slide',
		animSpeed: 100,
		effect: 'slide'
	});

	jQuery('.open-close-block').openClose({
		activeClass: 'active',
		opener: '.explain-btn',
		slider: '.explain-block',
		animSpeed: 100,
		effect: 'slide'
	});
}

